import { Route, BrowserRouter, Router } from 'react-router-dom';
import './App.css';
import Users from './Components/Users';
import AddUser from './Components/AddUser';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Router>
          <Route>
            <Route path="/" element={<Users />} />
            <Route path="/AddUser" element={<AddUser />} />
          </Route>
        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
